// }

function App1() {
    return(
        <div>
            <ContactCard 
                contact={{name:"superman", phone:"12", email:"@superman"
                }}
            />
            <ContactCard 
                contact={{name:"spiderman", phone:"34", email:"@superman"
                }}
            />
            <ContactCard 
                contact={{name:"superman", phone:"12", email:"@superman"
                }}
            />
            <ContactCard 
                contact={{name:"superman", phone:"12", email:"@superman"
                }}
            />
            <ContactCard name="" phone="" email="@"/>
            <ContactCard name="batman" phone="56" email="@batmna"/>
            <ContactCard name="ironman" phone="78" email="@ironman"/>
        </div>
    );
}


ReactDOM.render(<App1 />, document.getElementById('root'));
